import { useState } from "react";
import "./item.css"
import Form from "../form/form";
import ItemComp from "./itemcomp";



const RenderItem = () =>{
    const list_data= [{"username":"pankaj","age":32},
    {"username":"pankaj","age":32},
    {"username":"pankaj","age":32},
    {"username":"pankaj","age":32}];

    const [render,setRender] = useState(list_data);



    const saveData = (passData) =>{
        setRender([passData,...render]);
    }

    const Extract = render.map(each => <ItemComp key={each.key} username={each.username} age={each.age}/>)



    return(
        <div>
        <div class="mt-4 mb-5 container col-md-6">
            <Form getData={saveData}/>
        </div>
        <div class="item">
            {Extract}




        </div>
        </div>
    );

}

export default RenderItem;
